import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

class App extends React.Component {
    render(){
        return (
            <div className="App">
                <h1>Hello, React!</h1>
            </div>
        )
    }
}
